import React, {useEffect} from 'react';
import './App.scss';
import {Header} from "./Components/Header";
import {
    BrowserRouter as Router,
} from "react-router-dom";

function App() {

    return (
        <Router>
            <div>
                <Header/>

                <div className="main">
                    <div className="container">
                        <div className="main__inner">

                        </div>
                    </div>
                </div>

            </div>
        </Router>
    );
}

export default App;
